import React from "react";
import PercentWizard from "./PercentWizard";
import DollarWizard from "./DollarWizard"
class Calculators extends React.Component {
    constructor(props){
        super(props);
    }

    render() {
        const percentWizNumber = Number(this.props.percentCalculators.length)
        const dollarWizNumber = Number(this.props.dollarCalculators.length)
        const percentWizardRender = this.props.percentCalculators.map((wizNumber) =>
            <div>
                <PercentWizard
                percentWizardId={percentWizNumber}/>
            </div>
        )
        const dollarWizardRender = this.props.dollarWizardCount.map(() =>
            <div>
                <DollarWizard
                dollarWizardId={dollarWizNumber}/>
            </div>
        )

        return (
            <div className="tc ph4">
                <h2>2. Enter your pricing information:</h2>
                <div>
                    {percentWizardRender}
                </div>
                <div>
                    {dollarWizardRender}
                </div>
            </div>
        )
    }
}

export default Calculators;
